import './header.css';

function Header() {
  return (
      <header className="Header">
        <img></img>
        <div className="">
          <i className='material-icons  white' style={{ fontSize: '15px' }}>chevron_left</i>
        </div>
        <hr/>
      </header>
  );
}

export default Header;
